import "./App.css";
import Navbar from "./componets/Navbar";
import Home from "./componets/Home";
import About from "./componets/About";
import Portfolio from "./";

function App() {
  return (
    <>
      <Navbar />
      <Home />
      <About />
    </>
  );
}

export default App;
